/** @flow */
/* eslint no-duplicate-imports: ["error", { "includeExports": true }]*/

import {
    Profile,
    Calories,
    Nutrient,
    Protein,
    Carbohydrate,
    Fat,
} from './models';

import {
    bmr,
    macros,
} from './services';

export { Profile };

export const Models = {
  Calories,
  Nutrient,
  Protein,
  Carbohydrate,
  Fat,
};

export const Services = {
  bmr,
  macros,
};

export default {
  Profile,
  Models,
  Services,
};

/** @flow */
/* eslint no-restricted-syntax: [2, "class"] */

import Volume from './volume';
import type { TrainingVolume } from './volume';

const BASE_FACTOR = 1.2;
const LIGHT_FACTOR = 1.375;
const MEDIUM_FACTOR = 1.55;
const HEAVY_FACTOR = 1.725;

/**
 * Class representing Calories
 * @extends {Volume}
 */
class Calories extends Volume {
  /**
   * Calculates calories according to BMR.
   *
   * @param {number} bmr
   * @returns {Calories}
   */
  calculate(bmr: number): Calories {
    this.base = (BASE_FACTOR * bmr);
    this.light = (LIGHT_FACTOR * bmr);
    this.medium = (MEDIUM_FACTOR * bmr);
    this.heavy = (HEAVY_FACTOR * bmr);
    return this;
  }

  /**
   * Calculate calories based on calorie adjustment.
   *
   * @param {number} factor
   * @returns {Calories}
   */
  adjustment(factor: number): Calories {
    this.base = this.base + factor;
    this.light = this.light + factor;
    this.medium = this.medium + factor;
    this.heavy = this.heavy + factor;
    return this;
  }

  /**
   * Update calories.
   *
   * @param {TrainingVolume} [update]
   * @returns {Calories}
   */
  update(update ?: TrainingVolume): Calories {
    const input = update !== undefined ? update : {};
    const newBase = input.base || this.base;
    const newLight = input.light || this.light;
    const newMedium = input.medium || this.medium;
    const newHeavy = input.heavy || this.heavy;
    return new Calories({ base: newBase, light: newLight, medium: newMedium, heavy: newHeavy });
  }
}


export default Calories;

/** @flow */

import Calories from './calorie';
import Nutrient, { Protein, Carbohydrate, Fat } from './nutrient';
import Profile from './profile';

module.exports = {
  Calories,
  Nutrient,
  Protein,
  Carbohydrate,
  Fat,
  Profile,
};

/** @flow */

import Volume from './volume';

/**
 * Protein Object
 * @typedef {Object} ProteinRange
 * @property {number} low - Indicates a low protein range.
 * @property {number} high - Indicates a high protein range.
 */
type ProteinRange = {
  low: number,
  high: number
};

/**
 * Class representing a Nutrient Volume
 *
 * @export
 * @class Nutrient
 */
export default class Nutrient {
  protein: Protein;
  carbohydrate: Carbohydrate;
  fat: Fat

  /**
   * Creates an instance of Nutrient.
   * @param {Carbohydrate} carbohydrate
   * @param {Protein} protein
   * @param {Fat} fat
   *
   * @memberOf Nutrient
   */
  constructor(carbohydrate: Carbohydrate, protein: Protein, fat: Fat) {
    this.protein = protein;
    this.carbohydrate = carbohydrate;
    this.fat = fat;
  }
}

/**
 * Class representing a Protein
 *
 * @export
 * @class Protein
 */
export class Protein {
  low: number;
  high: number;

  /**
   * Creates an instance of Protein.
   * @param {ProteinRange} init
   *
   * @memberOf Protein
   */
  constructor(init: ProteinRange) {
    this.low = init.low;
    this.high = init.high;
  }

  /**
   * Create Protein from Array.
   *
   * @static
   * @param {number[]} input
   * @returns {Protein}
   *
   * @memberOf Protein
   */
  static fromArray(input: number[]): Protein {
    return new this({ low: input[0], high: input[1] });
  }
}

/**
 * Class representing a Carbohydrate
 *
 * @export
 * @class Carbohydrate
 * @extends {Volume}
 */
export class Carbohydrate extends Volume {}

/**
 * Class representing a Fat
 *
 * @export
 * @class Fat
 * @extends {Volume}
 */
export class Fat extends Volume {}

/** @flow */

import Calories from './calorie';
import Nutrient from './nutrient';

const CM_TO_INCHES = 0.393701;
const KG_TO_LBS = 2.20462;

/**
 * Profile Object
 * @typedef {Object} User
 * @property {string} firstName - Indicates a first name.
 * @property {string} lastName - Indicates a last name.
 * @property {number} height - Indicates a height in inches.
 * @property {number} weight - Indicates a weight in lbs.
 * @property {number} sex - Indicates a gender.
 * @property {string} age - Indicates age.
 */
type User = {
  firstName ?: string,
  lastName ?: string,
  height ?: number,
  weight ?: number,
  sex ?: string,
  age ?: number,
}

/**
 * Class representing a Profile.
 *
 * @export
 * @class Profile
 */
export default class Profile {
  firstName: string;
  lastName: string;
  height: number;
  weight: number;
  sex: string;
  age: number;
  bmr: number;
  calories: Calories;
  macros: Nutrient;

  /**
   * Creates an instance of Profile.
   * @param {User} [init]
   *
   * @memberOf Profile
   */
  constructor(init ?: User) {
    const input = init !== undefined ? init : {};
    this.firstName = input.firstName || '';
    this.lastName = input.lastName || '';
    this.height = input.height || 0;
    this.weight = input.weight || 0;
    this.age = input.age || 0;
    this.sex = input.sex || '';
  }

  /**
   * Add height to profile in centimeters.
   *
   * @param {number} height
   *
   * @memberOf Profile
   */
  addHeightInCM(height: number) {
    this.height = height * CM_TO_INCHES;
  }

  /**
   * Add height to profile in feet.
   *
   * @param {number} feet
   * @param {number} inches
   *
   * @memberOf Profile
   */
  addHeightInFeet(feet: number, inches: number) {
    this.height = (feet * 12) + inches;
  }

  /**
   * Add weight to profile in KGs.
   *
   * @param {number} weight
   *
   * @memberOf Profile
   */
  addWeightInKg(weight: number) {
    this.weight = weight * KG_TO_LBS;
  }

  /**
   * Set gender of profile to male.
   *
   *
   * @memberOf Profile
   */
  setMale() {
    this.sex = 'm';
  }

  /**
   * Set gender of profile to female.
   *
   *
   * @memberOf Profile
   */
  setFemale() {
    this.sex = 'f';
  }
}

/** @flow */
/* eslint no-restricted-syntax: [2, "class"] */

/**
 * Calorie Object
 * @typedef {Object} Calorie
 * @property {number} value - a numerical value for a Calorie.
 */
type Calorie = number;

/**
 * TrainingVolume Object
 * @typedef {Object} TrainingVolume
 * @property {Calorie} base - Indicates a base training volume.
 * @property {Calorie} light - Indicates a light training volume.
 * @property {Calorie} mediun - Indicates a medium training volume.
 * @property {Calorie} heavy - Indicates a heavy training volume.
 *
 */
export type TrainingVolume = {
  base ?: Calorie,
  light ?: Calorie,
  medium ?: Calorie,
  heavy ?: Calorie
}

/**
 * Class representing a Training Volume
 *
 * @private
 */
export default class Volume {
  base: Calorie;
  light: Calorie;
  medium: Calorie;
  heavy: Calorie;

  /**
   * @param  {TrainingVolume} init
   * @returns Volume
   */
  constructor(init ?: TrainingVolume) {
    const input = init !== undefined ? init : {};
    this.base = input.base || 0;
    this.light = input.light || 0;
    this.medium = input.medium || 0;
    this.heavy = input.heavy || 0;
  }


  /**
   * Convert an generic Object into a Volume.
   *
   * @static
   * @param {any} obj
   * @returns @this
   *
   * @memberOf Volume
   */
  static fromObject(obj): * {
    return new this(obj);
  }


  /**
   * Convert an Array into a Volume
   *
   * @static
   * @param {Array<any>} input
   * @returns null
   *
   * @memberOf Volume
   */
  static fromArray(input: Array<any>): * {
    const result = {};
    input.forEach((i) => {
      result[i[0]] = i[1];
    });
    return this.fromObject(result);
  }


  /**
   * Get the Volume's value; "base", "light", "medium", "heavy".
   *
   * @param {string} value
   * @returns {number}
   *
   * @memberOf Volume
   */
  get(value: string): number {
    switch (value) {
      case 'base':
        return this.base;
      case 'light':
        return this.light;
      case 'medium':
        return this.medium;
      case 'heavy':
        return this.heavy;
      default:
        return 0;
    }
  }

  /**
   * Convert Volume to Array.
   *
   * @returns {Array<any>}
   *
   * @memberOf Volume
   */
  toArray(): Array<any> {
    return Object.keys(this).map((key) => [key, this.get(key)]);
  }

  /**
   * Returns Array of Volume key parameters.
   *
   * @returns {Array<string>}
   *
   * @memberOf Volume
   */
  keys(): Array<string> {
    return Object.keys(this);
  }

  /**
   * Returns Array of Volume values.
   *
   * @returns {Array<any>}
   *
   * @memberOf Volume
   */
  values(): Array<any> {
    return Object.values(this);
  }

  /**
   * Returns Array of Volume key: values.
   *
   * @returns {Array<any>}
   *
   * @memberOf Volume
   */
  entries(): Array<any> {
    return Object.entries(this);
  }
}

/** @flow */
/* eslint no-mixed-operators: ["error", {"groups": [["&", "|", "^", "~", "<<", ">>", ">>>"], ["&&", "||"]]}] */

/**
 * Bassal Metabolic Rate Object
 * @typedef {Object} Bmr
 * @property {number} height - Indicates a height in inches.
 * @property {number} weight - Indicates a weight in lbs.
 * @property {number} age - Indicates an age.
 * @property {string} sex - Indicates a gender.
 */
type Bmr = {
  height: number,
  weight: number,
  age: number,
  sex: string
};

/**
 * Calculate the BMR based on height, weight, age, and gender.
 *
 * @param {Bmr} init
 * @returns {number}
 */
const calculate = (init: Bmr): number => {
  switch (init.sex) {
    case 'm':
      return ((init.weight * 10) + (init.height * 6.25) - (init.age * 5) + 5);
    case 'f':
      return ((init.weight * 10) + (init.height * 6.25) - (init.age * 5) - 10);
    default:
      return 0;
  }
};

export default {
  calculate,
};

/** @flow */

import bmr from './bmr';
import macros from './macros';

module.exports = {
  bmr,
  macros,
};

/** @flow */
/* eslint no-mixed-operators: ["error", {"groups": [["&", "|", "^", "~", "<<", ">>", ">>>"], ["&&", "||"]]}] */

import { Calories, Protein, Carbohydrate } from '../models';

const PROTEIN_RANGE = [0.8, 1];
const CARB_RANGE = [0.5, 1, 1.5, 2];

/**
 * Macro Object
 * @typedef {Object} Macros
 * @property {Carbohydrate} carbohydrate Indicates a carbohydrate in grams.
 * @property {Protein} protein Indicates a protein in grams.
 * @property {Calories} calories Indicates calories based on training volume.
 */
type Macros = {
  carbohydrate: Carbohydrate,
  protein: Protein,
  calories: Calories,
}

/**
 * Calculate protein macros using weight.
 * @function calculateProtein
 * @param {number} weight
 * @returns {number[]}
 */
export const calculateProtein = (weight: number): number[] => PROTEIN_RANGE.map((val) => weight * val);

/**
 * Calculate carbohydrate macros using weight.
 * @function calculateCarbohydrate
 * @param {number} weight
 * @return Array<any>
 */
export const calculateCarbohydrate = (weight: number): Array<any> =>
  ['base', 'light', 'medium', 'heavy'].map((key, i) => [key, (weight * CARB_RANGE[i])]);

/**
 * Calculate fat macros using proteins, carbohydrates, and calories.
 * @function calculateFat
 * @param {Macros} macros
 * @return Array<any>
 */
export const calculateFat = (macros: Macros): Array<any> =>
  ['base', 'light', 'medium', 'heavy'].map((key) =>
    [key, (macros.calories.get(key) - (macros.carbohydrate.get(key) + macros.protein.low) * 4) / 9],
  );

export default {
  calculateProtein,
  calculateCarbohydrate,
  calculateFat,
};
